  "definitions": {
    "host_site_supervisor": "means a representative of the Host Site responsible for providing the direct on-campus supervision and support to ScholarCorps AmeriCorps Members along with overall program oversight. They are responsible for all program reporting requirements, performance measurements, and program evaluations.",
    "host_site": "means the partner organization hosting AmeriCorps members. A partner organization must have legal status as a state or local government, an Indian Tribe, a non-profit organization (religious organizations are permissible), or an educational institution, and provide one or more types of eligible programs as defined in 45 C.F.R. §2522.110. Host Sites are also responsible for designating a Host Site Supervisor.",
    "sponsor": "means Indiana Commission for Higher Education",
    "serve_indiana": "is a division of the Department of Workforce Development (DWD)"
  },
  "mou_outline": "This Memorandum of Understanding (MOU) outlines the roles, responsibilities, and expectations of the ScholarCorps AmeriCorps Program (as administered by the Indiana Commission for Higher Education), the Host Site, and the Host Site Supervisor. The Host Site will be awarded one full-time ScholarCorps AmeriCorps member (minimum 1,700 service hour requirement) in the upcoming 2019-2020 program year. The Indiana Commission for Higher Education’s ScholarCorps AmeriCorps program engages volunteers in full-time AmeriCorps service. Members who successfully complete a minimum 1700 hours of AmeriCorps service will receive a modest living allowance and are eligible to receive a $6,095 AmeriCorps Education Award. AmeriCorps Education Awards can be used to repay qualified student loans, or pay the cost of attending a qualified institution of higher education."
}
```

